import { render } from "@testing-library/react";
import React from "react";
import { Field, reduxForm } from "redux-form";

class CreateStream {
  renderInput = ({ formProps }) => {
    return <input {...formProps} />;
  };
  render() {
    return (
      <div>
        {this.renderInput}
        {this.renderInput}
      </div>
    );
  }
}

export default reduxForm({ form: "createStream" })(CreateStream);
